import React, { useState, useEffect } from 'react';

const GerenciarCategorias = () => {
  const [categorias, setCategorias] = useState([]);
  const [nova, setNova] = useState('');

  useEffect(() => {
    const salvas = JSON.parse(localStorage.getItem('minhasCategorias')) || [];
    setCategorias(salvas);
  }, []);

  const salvarNoStorage = (lista) => {
    setCategorias(lista);
    localStorage.setItem('minhasCategorias', JSON.stringify(lista));
  };

  const handlesalvar = (e) => {
    e.preventDefault();
    if (!nova.trim()) return;
    salvarNoStorage([...categorias, nova]);
    setNova('');
  };

  const excluir = (index) => {
    if (window.confirm("Confirmar exclus√£o desta categoria personalizada?")) {
      const lista = categorias.filter((_, i) => i !== index);
      salvarNoStorage(lista);
    }
  };

  return (
    <div style={{ padding: '40px', maxWidth: '1100px', margin: '0 auto' }}>
      <header style={{ marginBottom: '48px' }}>
        <h1 style={{ color: 'var(--primary-navy)', fontSize: '32px', margin: '0 0 8px 0' }}>üìÇ Gest√£o de Categorias</h1>
        <p style={{ color: '#64748b', fontSize: '18px' }}>Adicione e gerencie as categorias exclusivas do seu torneio.</p>
      </header>

      <section className="glass-card" style={{ marginBottom: '40px' }}>
        <form onSubmit={handlesalvar} style={{ display: 'flex', gap: '16px' }}>
          <input 
            className="input-premium"
            placeholder="Ex: Mista Open Solid√°ria"
            value={nova}
            onChange={(e) => setNova(e.target.value)}
          />
          <button type="submit" className="btn-primary" style={{ whiteSpace: 'nowrap' }}>
            + ADICIONAR CATEGORIA
          </button>
        </form>
      </section>

      <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '20px' }}>
        {categorias.map((cat, i) => (
          <div key={i} className="category-item">
            <span>{cat}</span>
            <div style={{ display: 'flex', gap: '8px' }}>
              <button 
                onClick={() => {
                  const novo = prompt("Novo nome:", cat);
                  if (novo) {
                    const l = [...categorias]; l[i] = novo; salvarNoStorage(l);
                  }
                }}
                style={{ background: '#f1f5f9', border: 'none', padding: '10px', borderRadius: '8px', cursor: 'pointer', color: 'var(--accent-blue)' }}
              >
                ‚úèÔ∏è Editar
              </button>
              <button 
                onClick={() => excluir(i)}
                style={{ background: '#fef2f2', border: 'none', padding: '10px', borderRadius: '8px', cursor: 'pointer', color: 'var(--crimson-danger)' }}
              >
                üóëÔ∏è Excluir
              </button>
            </div>
          </div>
        ))}
      </div>

      <footer style={{ marginTop: '60px', padding: '24px', borderTop: '1px solid var(--border-light)' }}>
        <span style={{ color: '#94a3b8', fontSize: '14px', textTransform: 'uppercase', letterSpacing: '1px' }}>
          üîí Categorias Oficiais (Imut√°veis)
        </span>
        <div style={{ display: 'flex', flexWrap: 'wrap', gap: '10px', marginTop: '16px', opacity: 0.7 }}>
          {['Fem PRO', 'Masc PRO', 'Sub-14', 'Masters +40', 'Open Mista'].map(p => (
            <span key={p} style={{ background: '#e2e8f0', padding: '6px 12px', borderRadius: '6px', fontSize: '12px' }}>{p}</span>
          ))}
        </div>
      </footer>
    </div>
  );
};

export default GerenciarCategorias;
